import React, { Component } from 'react';
import {Link} from 'react-router-dom';
import Charts from '../components/Charts'

export default class PosProps extends Component {

    /*<td><button style={btnDelStyle} onClick = {this.props.delSymbol.bind(this,symbol)}>x</button></td>*/
    
    render() {
        const roundTo = require('round-to')
        const {ticker, shares, investCost, currentCost, margin, marginPercentage} = this.props.item;
        
        return (
            <tr>
                <th><button style={btnSymStyle} onClick={()=>{this.props.setChartsTicker(ticker)}}>{ticker}</button></th>
                <td>{shares}</td>
                <td>{investCost}</td>
                <td>{currentCost}</td>
                <td>{margin}</td>
                <td>{marginPercentage}</td>
                <td><button>chart</button></td>
            </tr>
        )
    }
}
const btnSymStyle ={
    background:'transparent',
    border: 'none',
    color: 'skyblue',
    fontSize: '0.7rem'
}
